import requests


class Bitspay:
    def __init__(self):
        self.headers = {"Content-Type": "application/json"}
        self.urlOrderbooks = f"https://api.bitspay.io/orderbook/BTC_USDT"

    def get_funcname(self):
        return Bitspay.__name__

    def get_orderbook(self):
        orderbook = requests.get(url=self.urlOrderbooks, headers=self.headers).json()
        # return orderbook
        topAsk = float(orderbook["asks"][0]["price"])
        ask_volume = float(orderbook["asks"][0]["quantity"])
        topBid = float(orderbook["bids"][0]["price"])
        bid_volume = float(orderbook["bids"][0]["quantity"])
        return {"topAsk": topAsk, "topBid": topBid, "ask_volume": ask_volume, "bid_volume": bid_volume}

